import React from 'react';
import axios from 'axios'
function InstagramLogin(props) {


    let login = () =>{
        axios.get('http://localhost:5000/login/groups?')
        .then(response => {
            console.log(response.data)
        })
    }

    let content = (<button onClick={login}>Insta Login</button>)

    return (
        <div>
            {content}
        </div>
    );
}

export default InstagramLogin;
